import React from "react";
import { BsCurrencyDollar } from "react-icons/bs";
import { TopHeading, Items, Logo, CartIcons, Menu } from "../../styles/topNav";

class TopNav extends React.Component {
  constructor(props: any) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <>
        <TopHeading>
          <Menu>
            <Items>WOMEN</Items>
            <Items>MEN</Items>
            <Items>KIDS</Items>
          </Menu>

          <Logo>
            <BsCurrencyDollar />
          </Logo>

          <CartIcons>
            <BsCurrencyDollar />
          </CartIcons>
        </TopHeading>
      </>
    );
  }
}

export default TopNav;
